import { FunctionComponent } from "react";
import { Link } from "react-router-dom";

interface FooterProps {
  setUserInfo: Function;
  userInfo: TokenDetails | false;
}

const Footer: FunctionComponent<FooterProps> = ({ userInfo, setUserInfo }) => {
  return (
    <>
      <div>
        <div className="footer">
          <div className="col">
            <h5>Account</h5>
            <hr />

            <ul style={{ listStyleType: "none", paddingLeft: 0 }}>
              <Link className="nav-link" to={`users/user-profile/${userInfo._id}`}>
                <li>User Profile</li>
              </Link>
              <li>Cart</li>
            </ul>
          </div>
          <div className="col">
            <h5>Account</h5>
            <hr />

            <ul style={{ listStyleType: "none", paddingLeft: 0 }}>
              <li>User Profile</li>
              <li>Cart</li>
            </ul>
          </div>
          <div className="col">
            <h5>Account</h5>
            <hr />

            <ul style={{ listStyleType: "none", paddingLeft: 0 }}>
              <li>User Profile</li>
              <li>Cart</li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default Footer;
